<script>


//function to find width of screen, if below certain width, resize map to take entire screen
        // also resize dataholder to the entire screen
        // force map to height that allows the data holder a little bit of room on the screen. maybe like a 70/30 split
//var w = window.innerWidth;
//add event listener to fire on screen resize as well as on page load
//#ontario_map 

function calcResize() {
    let hWin = window.innerHeight;
    let hScreen = window.screen.height
    let wScreen = window.screen.width
    console.log("screen ", hScreen)
    let mapWin = document.getElementById("canada_map")
    let parWin = mapWin.parentNode;
    let parWinNums = mapWin.parentNode.getBoundingClientRect();
    console.log(parWinNums.height)
    console.log(hWin)
    let dataWin = document.querySelector(".data_holder")
    //If screen less than 1200px, stack elements on top of each other, make everything full width
    
    if (hScreen < 1080 && parWinNums.width < 600) {
        mapWin.style.height = `${hScreen/2}px`
        mapWin.style.width = `${wScreen}px`
        dataWin.style.width = `${parWinNums.width-55}px`
    }
    else if (parWinNums.width < 1200) {
        mapWin.style.width = `${parWinNums.width+20}px`
        dataWin.style.width = `${parWinNums.width-55}px`
    }
    else if (parWinNums.height > hWin && parWinNums.width) {
        mapWin.style.height = `${hWin-300}px`
    }

    //width="900" height="868" viewBox="0 0 800 868"
}


</script>
<style>

    .map-btn {
        padding: 0.5rem;
        border-radius:0.5rem;
        background-color:#c9c9c9;
        border: 1px solid #969696;
        width: fit-content;
    }
    .map-btn:hover {
        filter: brightness(0.9);
        cursor: pointer;
    } 

    .mcg:hover path {
        fill:rgb(241, 132, 132);
        cursor: pointer;
    }

    .data_holder {
        border: 2px solid #c9c9c9;
        box-shadow: rgba(0, 0, 0, 0.16) 0px 1px 4px;        
        border-radius: 0.25rem;
        background-color: #fffdfd;
        font-family: "Arial";
        padding: 0.25rem 1rem;
    }

    #canada_map {
        border: 2px solid #c9c9c9;
        border-radius: 0.25rem;
    }

    .page-flex {
        display: flex;
        gap: 1rem;
        flex-wrap: wrap;
    }

    .page-flex div{
        flex: 1 1 500px;
    }

    .riding_name {

        margin: 0.25rem 0;
    }

    .data_holder h6:first-of-type {

    .riding_note {

        font-size: 1rem;
        margin: 0.75rem 0;
    }
    .riding_note_text {
        font-weight: 400;
        text-wrap: wrap;
    }

    .article_section a {
        text-decoration: none;
    }

            let new_opt = document.createElement("option");
            new_opt.setAttribute("value",riding.riding_name)
            new_opt.setAttribute("id", "data-"+ riding.riding_id)
            datalist.appendChild(new_opt)
        })

    <div class="data_holder">
        <h5 class="riding_name"></h5>
        <h6 class="riding_inc"></h6>
        <div class="riding_info_grid">
            <div>
                <h6 class="riding_note">Click on a riding to get started   
                </h6>
                <span class="riding_note_text"></span>
            </div>

            <div class="article_section">
                <h6 class="article_section_title"></h6>
                <a class="riding_art1_link" href="#" target="_blank">
                    <h6 class="riding_art1"></h6>
                </a>
                <a class="riding_art2_link" href="#" target="_blank">
                    <h6 class="riding_art2"></h6>
                </a>

                </a>

      <style>
        .riding_info_grid {
            border: 2px solid red;
            grid-template-columns: 1fr 1fr;
        }

        path:hover {
            fill:rgb(241, 132, 132);
            cursor: pointer;
        }

      </style>


<script src="zoom.js"></script>
<script>

function clearArt() {
    let artSection = document.querySelector(".article_section")
    artSection.innerHTML=""
}

function loadArt(ridingID) {
    fetch("fed_articles_by_candidate_csv.csv")
    .then(response => response.text())
    .then(csvText => {
        //console.log("test"+ ridingID)
        const rows = csvText.split("\n").map(row => row.split(","));
        let artSection = document.querySelector(".article_section")
        //console.log(artSection)
        rows.forEach((row) => {
            if (row[1] == ridingID) {
                //console.log(row)
                //create a div
                let artDiv = document.createElement("div")
                artDiv.innerHTML = row[4]
                artSection.appendChild(artDiv)
            }
        })
    })
    .catch(error => console.error("Error loading dataCSV:", error));


}


function info_show_search(riding) {
    clearArt()
    //use argument to pass in data-attr from the specific riding
    fetch("CAN_electoral_map_data1.csv")
    .then(response => response.text())
    .then(csvText => {
        const rows = csvText.split("\n").map(row => row.split(","));
        //console.log(rows); // Array of arrays
        rows.forEach(row => {
            if (row[1] == riding) {
                cardData = row
                //console.log(cardData)
            } 
        })

        loadArt(cardData[0])

        let rName = document.querySelector(".riding_name")
        let rInc = document.querySelector(".riding_inc")
        let rNote = document.querySelector(".riding_note_text")
        let rNoteTitle = document.querySelector(".riding_note")
        //Articles
        //console.log(cardData)
        let rArt1 = document.querySelector(".riding_art1_link")
        rName.innerHTML = cardData[1]
        rInc.innerHTML = `Incumbent: ${cardData[2]} ${cardData[3]}`
        rNote.innerHTML = cardData[4]
        rNoteTitle.innerHTML = 'Notes'

        //console.log(rArt1)
        rArtSectTitle = document.querySelector(".article_section_title")
        if (rArt1!="") {
            rArtSectTitle.innerHTML = "Related Articles"
            rArtSectTitle.style.marginTop = '0.5rem'
        }
        
    })
    .catch(error => console.error("Error loading CSV:", error));
}



function info_show(element, riding) {
    clearArt()
    let cardData;
    try{
            //remove fill from all other ridings
        let svgRdg = document.querySelectorAll("path")
        svgRdg.forEach(elem => {
            elem.style.fill = ""
        })
        //show active riding
        element.style.fill = "red"
    } catch {
        console.log('no element data')
    }
    //If no element data add something for search 
    
    //use argument to pass in data-attr from the specific riding
    fetch("CAN_electoral_map_data1.csv")
    .then(response => response.text())
    .then(csvText => {
        const rows = csvText.split("\n").map(row => row.split(","));
        //console.log(rows); // Array of arrays
        rows.forEach(row => {
            if (row[0] == riding) {
                cardData = row
                console.log(cardData)
            } 
        })
        let rName = document.querySelector(".riding_name")
        let rInc = document.querySelector(".riding_inc")
        let rNote = document.querySelector(".riding_note_text")
        let rNoteTitle = document.querySelector(".riding_note")
        //Articles
        //console.log(cardData)
        loadArt(cardData[0])

        let rArt1 = document.querySelector(".riding_art1_link")
        rName.innerHTML = cardData[1]
        rInc.innerHTML = `Incumbent: ${cardData[2]} ${cardData[3]}`
        rNote.innerHTML = cardData[4]
        rNoteTitle.innerHTML = 'Notes'
        //console.log(rArt1)
        rArtSectTitle = document.querySelector(".article_section_title")
        if (rArt1!="") {
            rArtSectTitle.innerHTML = "Related Articles"
            rArtSectTitle.style.marginTop = '0.5rem'
        }
    })
    .catch(error => console.error("Error loading CSV:", error));
}



window.onload = calcResize;
window.onresize = calcResize;
</script>
</body>
